import React from 'react';
import styled from 'styled-components';

import { Title } from './landing';

const SubTitle = styled.h2`
  font-size: 2rem;
  font-weight: 400;
`;

const Container = styled.div`
  background: yellow;
  height: 100%;
  text-align: center;
`;

function Theme() {
  return (
    <Container>
      <Title thin>
        Welcome, <strong>Suyeon</strong>
      </Title>
      <SubTitle>Choose your favorite theme</SubTitle>
    </Container>
  );
}

export default Theme;
